// react
import React, { Component } from 'react';

// third-party
import { NavLink } from 'react-router-dom';

// data
import data from './../../data/data';

export class NavLinks extends Component {
    render() {
        //const subList = data.NavLinks.sublist.map((subitem, index) => (
        //    <li key={index} className="nav-sublist__item">
        //        <NavLink exact to={subitem.url}>
        //            <span>
        //                {subitem.title}
        //            </span>
        //        </NavLink>
        //    </li>
        //));

        const navLinks = data.NavLinks.map((item, index) => (
            <li key={index} className="nav-links__item">
                <NavLink exact activeClassName="selected" to={item.url}>
                    <span>
                        {item.title}
                    </span>
                </NavLink>
                {/* TODO: Create sublist */}
                <div className="nav-sublist">
                    <ul>
                        <li>
                            {item.sublist[0].url}
                        </li>
                    </ul>
                </div>
            </li>
        ));



        return (
            <div className="nav-links">
                <ul className="nav-links__list">
                    {navLinks}
                </ul>
            </div>
        );
    }
}
